                <tr>
                  <td className="text-center">1</td>
                  <td>Nguyễn Phạm Trúc Phương</td>
                  <td className="text-center">nguyenphuong2605@gmail.com</td>
                  <td className="text-center">0965988011</td>
                  <td className="row">
                    <Link
                      type="button"
                      className="btn btn-sm mr-2 btn-items"
                      to="/admin/quanlyuser/info"
                    >
                      Chi tiết
                    </Link>
                    <button
                      type="button"
                      className="btn btn-sm btn-items"
                    >
                      Delete
                    </button>
                  </td>
                </tr>
          </tbody>
        </table>
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {

  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    getData: () => dispatch({type: "USER_GET_REQUEST"})
  };
};
